trailingComments.value:
*
 * 保存照片并分享
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @return {Promise<void>}
 *
 * @example
 * const params = {
 *   imageUrl: 'http://img-tailor.11222.cn/pm/book/operate/2018090314332207.png', // 必填
 *   shareFrom: 'act_314_zhima', // 可选
 * };
 * libSQ.exec('share-image', { params }).catch((err) => {
 *   alert(`[share-image][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });
 *

